result:
query Producto ($path: String!) {
  producto: ContentfulPasopticos(path: $path){
        slug
        image{
          secure_url
        }
        categoria{
          title
          slug
        }
        title
        fichaTecnica{
          description
          file{
            url
          }
        }
        relacion{
          title
          image{
            secure_url
          }
          path
        }

  }

}
